import React from 'react';
import Stats from './Stats';
import Stopwatch from './Stopwatch';
const Header = (props) => {
  const { players,title } = props;
    return (
      <header>
        <Stats players={players}/>
        <h1>{ title }</h1>
        <Stopwatch />
        {/* <span className="stats">Players: {props.totalPlayers}</span>  */}
      </header>
    );
  }

  export default Header;
